import React from "react";
import "bootstrap/dist/js/bootstrap.min.js";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <React.Fragment>
      <div style={{ display: 'flex', height: '100vh', alignItems: 'start' }}>

        <div className="sidebar" style={{ width: '200px', backgroundColor: '#f0f0f0' }}> {/* Adjust sidebar width and style as needed */}
          <Link to="/phone">Telefon</Link>
          <Link to="/pc">Számítógép</Link>
          <Link to="/headphones">Fülhallgató</Link>
          <Link to="/hardver">Hardver</Link>
          <Link to="/tv">TV</Link>
          <Link to="/other">Egyéb</Link>
        </div>

        <div style={{ flexGrow: 1, display: 'flex'}}><h1>Legújabb hirdetések</h1></div>
        <div style={{ flexGrow: 1, display: 'flex', justifyContent: 'center' }} className="list">
          <div style={{ alignSelf: 'start' }}>
            <h1>Iphone 13</h1>

          </div>
        </div>
      </div>
    </React.Fragment>
  );
}
